import React, { Component } from 'react';
import MaterialIcon from 'material-icons-react';
import './reports.css';
//import Container from './Container';

class ReportOption extends Component {
    handleContainerChange(){
        this.props.funcionClick(this.props.componente);
        //console.log(this.props.funcionClick);
    }
  	render() {
  	  	return (
            <div id={this.props.tab} className="reportBbtn" style="width:120px;" data-role="win-btn" data-state="enable"> 
                <MaterialIcon size={50} icon={this.props.icono} invert />
                <i className="material-icons" style="color:#FFF; font-size:24px; width:100%;top:10px">insert_chart</i>
                <button className="save" os="windows">Informes</button>
            </div>
  				    				
			  );
  	}
}

export default ReportOption

